import portfolio__arrow from '../../images/portfolio__arrow.svg';

function Portfolio() {
    return (
        <div className="portfolio">
            <h2 className="portfolio__title">Портфолио</h2>
            <ul>
                <li>Статичный сайт</li><img src={portfolio__arrow}></img>
            </ul>
        </div>
    );
}

export default Portfolio;
